import React, {FC} from 'react';
import Layout from 'components/global/layout';
import 'antd/dist/antd.css';
import { Input } from 'antd';
import './styles.scss';


interface IProps {};
const { TextArea } = Input;
export const PublicTransport: FC<IProps> = () => (
  <Layout title="PublicTransport" description="This is the PublicTransport Page">
    {/* <div className="public-transport-page">
      <p>
        This is the <strong>PublicTransport</strong> page
      </p>
    </div> */}
  <div>
  <label htmlFor="title">Article Title:</label><br />
  <Input placeholder="Enter Article title" allowClear />
  <br />
  <br />
  <label htmlFor="body">Article Body:</label><br />
  <TextArea placeholder="Enter Body Context" allowClear />
  </div>
  </Layout>
);

export default PublicTransport;
